import axios from "axios";

export const getEvents=async()=>{
    try{
        const response=await axios.get('/api/workout/getEvents',{
            params:{
                cpage:1,
                rows:8,
                prfstate:'02',
            }
        })
        return response;
    }catch(e){
        console.log(e)
    }
};
